Create a JavaScript program that allows users to draw on an HTML5 canvas
model
Here is a JavaScript program that allows users to draw on an HTML5 canvas:

```javascript
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');

let isDrawing = false;
let x = -1;
let y = -1;

canvas.addEventListener('mousedown', (e) => {
  isDrawing = true;
  x = e.clientX;
  y = e.clientY;
});

canvas.addEventListener('mousemove', (e) => {
  if (isDrawing) {
    const dx = e.clientX - x;
    const dy = e.clientY - y;
    const x2 = Math.round(dx);
    const y2 = Math.round(dy);
    const radius = Math.max(x2, y2);
    const color = 'black';

    ctx.beginPath();
    ctx.arc(x + dx, y + dy, radius, 0, 2 * Math.PI);
    ctx.stroke();

    x = e.clientX;
    y = e.clientY;
  }
});

canvas.addEventListener('mouseup', (e) => {
  isDrawing = false;
});
```

This program creates a canvas element and a context for it. It then listens for the mouse down event and the mouse move event. When the mouse is down, the program starts drawing on the canvas. When the mouse is moved, the program draws a circle on the canvas. When the mouse is up, the program stops drawing.

This program allows users to draw on the canvas with a mouse. They can draw circles, lines, and other shapes. They can also change the color of the lines and circles.

