in javascript i have a long string (up to 100 characters). I want to be able to encode this string into a short string so it's easily shareable via a url and then decode the shared string
model
To encode and decode a long string into a short string, you can use the Base64 encoding format. Base64 is a type of encoding that converts binary data into a set of 64 characters, which are commonly used in URLs.

Here's how to encode the string:
1. Convert the string into a binary array.
2. Use the `window.btoa()` method to encode the binary array into Base64.
3. Convert the encoded string back to a URL-safe string.

Here's how to decode the string:
1. Convert the encoded string back to a binary array.
2. Use the `window.atob()` method to decode the binary array from Base64.
3. Convert the decoded binary array back to a string.

Here's an example of how to encode and decode a string in JavaScript:
```javascript
function encode(str) {
  const binary = new Uint8Array(str.length);
  for (let i = 0; i < str.length; i++) {
    binary[i] = str[i].charCodeAt(0);
  }
  const encoded = window.btoa(binary);
  return encoded.replace(/=/g, ""); // Remove trailing "=" from encoded string
}

function decode(encoded) {
  const binary = window.atob(encoded);
  const decoded = new TextDecoder().decode(binary);
  return decoded;
}

const originalStr = "This is a long string that I want to encode.";
const encodedStr = encode(originalStr);
const decodedStr = decode(encodedStr);

console.log(`Original string: ${originalStr}`);
console.log(`Encoded string: ${encodedStr}`);
console.log(`Decoded string: ${decodedStr}`);
```

This example will output the following results:
```
Original string: This is a long string that I want to encode.
Encoded string: 5411101010101101101011110110110110110101101011011010110110101101101011010110101

